    <MainHomeContainer>
    <Header/>
     <MainHomePg>
            <SearchBar/>
            <MainContainer>
            <CardsInfos/>
            <CardsInfos/>
            <CardsInfos/>
            <CardsInfos/>
            <CardsInfos/>
            <CardsInfos/>
            </MainContainer>
        </MainHomePg>
    <Footer/>
    </MainHomeContainer>
  )  
};
